import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <div className="footer-logo">
          <img src="/images/logo1.png" alt="Little Lemon Logo" />
        </div>
        <div className="footer-text">
          <p>Copyright Little Lemon</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
